import React from 'react';

import Home from '../Main/Home/index';
import About from '../Main/About/index';
import Contact from '../Main/Contact/index';
import Service from '../Main/Services/index';
import Navbar from '../src/Component/Navbar/index';
import { Switch, Route, Redirect } from 'react-router-dom';
const Main = () => {
  return (
    <>
      <Navbar />
      {/* switch is liye use kr rhe taki multiple page me se koi ek hi page dikhega jo match 
    ho jae */}
      <Switch>
        <Route exact path="/" component={Home} />
        {/* <Home />  ab iski need nhi hia hum route ha use kr ke path define krdege. */}
        <Route exact path="/about" component={About} />
        <Route exact path="/service" component={Service} />
        <Route exact path="/contact" component={Contact} />
        <Redirect to="/" />
      </Switch>
    </>
  );
};

export default App1;
